def decodeMorse(morse_code):
    d = {'.-': "A", '-...': "B", '-.-.': "C", '-..': 'D', '.': 'E', '..-.': 'F', '--.': 'G', '....': 'H', '..': 'I', '.---': 'J', '-.-': 'K', '.-..': 'L', '--': 'M', '-.': 'N', '---': 'O', '.--.': 'P', '--.-': 'Q','...---...':'SOS', '.-.': 'R', '...': 'S', '-': 'T', '..-': 'U', '...-': 'V', '.--': 'W', '-..-': 'X', '-.--': 'Y', '--..': 'Z','-.-.--':'!','.-.-.-':'.'}
    return " ".join([''.join([d[x] for x in morse.split()]) for morse in morse_code.split('   ')]).strip()
n=decodeMorse('   ...---... -.-.--   - .... .   --.- ..- .. -.-. -.-   -... .-. --- .-- -.   ..-. --- -..-   .--- ..- -- .--. ...   --- ...- . .-.   - .... .   .-.. .- --.. -.--   -.. --- --. .-.-.-')
print(n)
